function Footer() {
    return <section>
        <div className="f-content d-flex flex-row container justify-center">
            <footer>
                <blockquote className="text-muted"><small>Hola soy pepito</small></blockquote>
            </footer>
        </div>
    </section>
}

export default Footer;
